
<!DOCTYPE html>
<html lang="fr">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Obtenir un Skin Exclusif sur Brawl Stars</title>
    <style>
        body {
            font-family: 'Brawl Stars', sans-serif;
            background-color: #4a007d;
            color: white;
            text-align: center;
            padding: 50px;
            margin: 0;
            overflow: hidden;
        }
        #main-content {
            border: 2px solid #000;
            background-color: #6500a1;
            padding: 20px;
            box-shadow: 0px 0px 20px rgba(0,0,0,0.8);
            border-radius: 15px;
            width: 50%;
            margin: 0 auto;
        }
        #main-content img {
            width: 250px;
        }
        .button {
            display: inline-block;
            background-color: #ffcc00;
            color: black;
            padding: 10px 20px;
            margin: 10px;
            text-decoration: none;
            font-size: 20px;
            font-weight: bold;
            border-radius: 10px;
            cursor: pointer;
        }
        .button:hover {
            background-color: #ffa700;
        }
        .popup {
            position: fixed;
            width: 300px;
            height: 200px;
            background-color: #ff0000;
            border: 3px solid #000;
            box-shadow: 0px 0px 20px rgba(0,0,0,0.5);
            padding: 20px;
            z-index: 9999;
            border-radius: 10px;
            color: white;
            text-align: center;
        }
        .popup h2 {
            font-size: 18px;
            color: yellow;
        }
        .popup p {
            font-size: 16px;
            font-weight: bold;
        }
        .popup .close {
            position: absolute;
            top: 5px;
            right: 10px;
            font-size: 18px;
            color: white;
            cursor: pointer;
        }

        /* Overlay styles */
        #overlay {
            position: fixed;
            bottom: 0;
            left: 0;
            width: 100%;
            background-color: black;
            color: white;
            font-size: 20px;
            text-align: center;
            padding: 10px;
            z-index: 10000;
            display: none;
            animation: flashing-border 1s infinite, grow-shrink 2s infinite;
        }

        @keyframes flashing-border {
            0% {border: 10px solid yellow;}
            50% {border: 10px solid red;}
            100% {border: 10px solid yellow;}
        }

        @keyframes grow-shrink {
            0% {transform: scale(1);}
            50% {transform: scale(1.1);}
            100% {transform: scale(1);}
        }

        /* Fullscreen freeze style with blue screen */
        #final-screen {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: black;
            background-image: url('blue screen.webp');
            background-size: cover;
            background-position: center;
            z-index: 100000;
        }
    </style>
    <script>
        let popupSpeed = 500; // Initial speed for popup generation (faster)
        let popupCount = 0; // Count for the number of popups
        let overlayShown = false; // Overlay visibility state

        const messages = [
            "Attention ! Votre PC est infecté !",
            "TOUTES vos données sont en danger !",
            "Votre connexion Internet est compromise !",
            "Vous avez été piraté !",
            "Un virus dangereux a été détecté !",
            "Protégez vos informations MAINTENANT !",
            "Votre ordinateur est sous attaque !",
            "Une menace critique a été détectée sur votre PC !"
        ];

        function getRandomMessage() {
            return messages[Math.floor(Math.random() * messages.length)];
        }

        function getRandomPosition() {
            const x = Math.random() * (window.innerWidth - 300);
            const y = Math.random() * (window.innerHeight - 200);
            return { x, y };
        }

        function showErrorPopups() {
            if (popupCount >= 50) {
                document.getElementById("final-screen").style.display = "block";  // Show the final freeze screen after 50 pop-ups
                return;
            }

            setTimeout(function generatePopup() {
                let popup = document.createElement("div");
                popup.classList.add("popup");

                const position = getRandomPosition();
                popup.style.left = position.x + "px";
                popup.style.top = position.y + "px";

                popup.innerHTML = `
                    <span class='close'>X</span>
                    <h2>ALERTE CRITIQUE !</h2>
                    <p>${getRandomMessage()}</p>
                    <p>Votre système est en danger !</p>
                `;
                document.body.appendChild(popup);

                // Show overlay after the first popup
                if (!overlayShown) {
                    document.getElementById("overlay").style.display = "block";
                    overlayShown = true;
                }

                // Accelerate the pop-up generation speed
                popupSpeed = popupSpeed * 0.9;  // Decrease interval by 10%
                popupCount++;  // Increment the pop-up count
                setTimeout(generatePopup, popupSpeed);
            }, popupSpeed);
        }

        function fakeSite() {
            document.getElementById("main-content").classList.add("hidden");
            showErrorPopups();  // Start generating pop-ups
            startCountdown();  // Start the countdown
        }

        function startCountdown() {
            let countdownTime = 600; // Countdown starts from 10 minutes
            let countdownDisplay = document.getElementById('countdown');
            let interval = setInterval(() => {
                let minutes = Math.floor(countdownTime / 60);
                let seconds = countdownTime % 60;
                seconds = seconds < 10 ? '0' + seconds : seconds;
                countdownDisplay.textContent = `Temps restant: ${minutes}:${seconds} | Appelez le 05 84 47 85 20 pour obtenir de l'aide.`;
                
                countdownTime--;
                if (countdownTime < 0) {
                    clearInterval(interval);
                    countdownDisplay.textContent = "Temps écoulé ! Toutes vos données sont perdues !";
                }
            }, 1000);
        }
    </script>
</head>
